import { Box, Typography, Paper } from "@mui/material";
import Chatbot from "../components/Chatbot";
function Discover() {
 return (
    <Box sx={{ height: "100vh", padding: 2, display: "flex", flexDirection: "column" }}>
      {/* First Section (70%) */}
      <Box sx={{ flex: 7, display: "flex", flexDirection: "column" }}>
        <Box sx={{ flex: 1, display: "flex", gap: 2 }}>
          {/* Left Section */}
          <Paper sx={{ flex: 1, padding: 2, display: "flex", alignItems: "center", justifyContent: "center" }}>
            <Typography variant="h5">Left Section</Typography>
          </Paper>

          {/* Right Section */}
          <Paper sx={{ flex: 1, padding: 2, display: "flex", alignItems: "center", justifyContent: "center" }}>
            <Typography variant="h5">Right Section</Typography>
          </Paper>
        </Box>
      </Box>

      {/* Second Section (30%) */}
      <Box sx={{ flex: 3, marginTop: 2 }}>
        <Paper sx={{ width: "100%", height: "100%", padding: 2, display: "flex", alignItems: "center", justifyContent: "center" }}>
          <Typography variant="h5">Bottom Section</Typography>
        </Paper>
      </Box>
    </Box>
 );
}
export default Discover;
